import { Link } from "react-router-dom"

const Navigation = () =>
{
    return(
    <div id="nav">
<Link to="/" class="navbar" ><button>  color: black;</button></Link>
<Link to="/about" class="navbar">About</Link>
<Link to="/contact" class="navbar">About</Link>
    </div>
    );
}
export default Navigation;
